var PlMap = new Class({
	Implements: [Events, Options],
	options: {
		mapElement: 'map_pl'			// set element
	},
	initialize: function (options) {
		this.setOptions(options);
		this.startMap();
	},
	startMap: function () {
		var map = $(this.options.mapElement);
		
		var infoBox = new Element('div.info-box').inject($(document.body), 'top');
		var infoBoxOver = new Element('div#info-box-over', {'html' : '<div id="info-box-visible"><div id="ibv-close">close</div>adresy</div>'}).inject($(document.body), 'bottom');
		var listObject = $('map_p_list').getChildren();
		
		regions.each(function (element, index) {
			map.set({
			'version':'1.1',
			'xmlns': 'http://www.w3.org/2000/svg',
			'xmlns:xlink': 'http://www.w3.org/1999/xlink',
			'x': '0px',
			'y': '0px',
			'width': '800',
			'height': '800',
			'viewBox': '0 0 800 800',
			'style': 'enable-background:new 0 0 800 800;',
			'xml:space': 'preserve'
			});
			map.grab(new Element('path', {'id': element.reg_id, 'class': 'reg', 'd': element.reg_path, 'regionurl-data': element.reg_id, 'regionname-data': element.reg_name, 'regioncode-data': element.reg_code }).addEvents({
				click: function(event){
					event.stopPropagation();
					event.stop();
					clearElements ();
					if (element.reg_click_status === 0) {
						this.addClass('selected');
						regions.each(function(el){
							el.reg_click_status=0;
						});
						element.reg_click_status = 1;
					} else if (element.reg_click_status === 1) {
						this.removeClass('selected');
						element.reg_click_status = 0;
					}
					setInfoBox(element.reg_code, listObject);
					
				},
				mouseover: function(event){
					this.addClass('hovered');
					setInfo(element.reg_name);
					infoBox.addClass('visible');
				},
				mouseleave: function(event){
					this.removeClass('hovered');
					infoBox.removeClass('visible');
				},
				mousemove: function(event) {
					var mouseX = event.page.x;
			 		var mouseY = event.page.y;
					var boxSize = $$('.info-box').getSize();
			 		setInfoPos(mouseX, mouseY, boxSize[0].x, boxSize[0].y);
				}
			}));
			
			$('ibv-close').addEvent('click', function (event) {
				$('info-box-over').setStyle('display', 'none');
				$('map_pl').getChildren().removeClass('selected');
				$$('#info-box-visible .l-info').dispose();
			});
			
		});

		function setInfo (param) {
			infoBox.set('html', param);
		}
		
		function setInfoPos (posX, posY, elemWidth, elemHeight) {
			infoBox.setStyles({position: 'absolute', left: posX - elemWidth / 2, top: posY - (elemHeight + 10)});
		}
		
		function clearElements () {
			var el = $('map_pl').getChildren();
				el.removeClass('selected');
		}
		
		function setInfoBox(number, descriptions) {
			$('info-box-over').setStyle('display', 'block');
			
			descriptions.each(function (elem, index) {
				if (elem.id == 'reg_'+number) {
					elem.clone().getChildren().inject($('info-box-visible', 'top'));
				}
			});
			
		}
		
	}
});

